PhotoshopCAFE - Lightroom 3 for Digital Photographers 

This is the most comprehensive video on the market for Lightroom. Learn how to import, organize, develop and output all your captures with effortless ease. Enjoy in depth coverage, pro techniques, secret tips and Colins way of breaking down even the most complex tasks into quick and easy to understand techniques. Youll spend less time in front of the computer and more time behind the camera!
If you are new to Digital Photography,an old-hand or someone looking to learn the correct way of doing things, look no further. Watch over Colins shoulder as he demystifies Lightroom. Youll learn all the shortcuts, tips and tricks from a true expert. Do you ever get frustrated with tutorials that don't work in the real world? In many cases Colin shows you multiple methods so that you can choose the one thats best for your photo. This is not like other training videos. The techniques arent from a classroom bubble. This is what works today in the real-world. There are no monotone presentations with boring uninspiring images. You'll learn tons, you'll have fun and most of all youll be inspired. See why millions of people are passionate about PhotoshopCAFE training. (20,000,000 to date).

This fast loading DVD ROM/or Download contains 7.5 hours of sharp widescreen video. The advanced interface allows the user to instantly jump to any of the 99 lessons with complete control over the playback. All the lesson files are included, so you can follow along at your own pace!

